module.exports=[{name:"通用知识",icon:"align-right",categories:[{name:"设计模式",file:"common/design-pattern.md",id:"5bb84214",questions:[{question:"发布订阅模式 和 观察者模式 有什么关系？",question_body:"",answer:'<p>发布订阅模式属于广义上的观察者模式，是其最常见的一种实现</p>\n<p>发布订阅模式会比「典型的观察者模式」多一个「发布订阅中心」</p>\n<p><strong>典型观察者模式</strong></p>\n<pre class="language-unknown"><code>+-----------+  Fire Event  +------------+\n|           |-------------&gt;|            |\n|  Subject  |              |  Observer  |\n|           |&lt;-------------|            |\n+-----------+   Subscribe  +------------+</code></pre><p><strong>发布订阅模式</strong></p>\n<pre class="language-unknown"><code>+-----------+               +---------------+  Fire Event  +------------+\n|           | Publish Event |               |-------------&gt;|            |\n| Publisher |--------------&gt;| Event Channel |              | Subscriber |\n|           |               |               |&lt;-------------|            |\n+-----------+               +---------------+   Subscribe  +------------+</code></pre><p>参考：<a href="https://www.zhihu.com/question/23486749">https://www.zhihu.com/question/23486749</a></p>\n'},{question:"用代码实现发布订阅模式",question_body:"",answer:"<p>emmm...todo</p>\n"}]},{name:"网络",file:"common/network.md",id:"810a0276",questions:[{question:"TCP 建立连接 为什么是三次握手？",question_body:"",answer:"<p>第一次：client -&gt; server，你能收到我的消息吗？</p>\n<p>第二次：client &lt;- server，能收到，你能收到我的消息吗？</p>\n<p>第三次：client -&gt; server，我也能收到你的消息</p>\n<p>信道不可靠，至少需要三次握手来确保信道是<strong>&quot;可用的&quot;</strong>，<strong>确保双方能收能发</strong></p>\n"},{question:"TCP 释放连接 为什么是四次挥手",question_body:"",answer:"<p>前两次用来释放 client -&gt; server 方向的连接</p>\n<p>后两次用来释放 client &lt;- server 方向的连接</p>\n"},{question:"介绍下 http 2.0 中的多路复用",question_body:"",answer:""},{question:"从输入 URL 到页面加载完成，发生了什么？",question_body:"",answer:"<ol>\n<li>DNS 查询</li>\n<li>建立 TCP 连接</li>\n<li>...</li>\n</ol>\n"}]}],id:"703bbe45"},{name:"前端基础",icon:"code",categories:[{name:"JavaScript 基础",file:"basic/javascript.md",id:"11275c3e",questions:[{question:"JavaScript 中有哪些内置类型",question_body:"",answer:"<p>6大基本类型 和 对象</p>\n"},{question:"JavaScript中的基本类型",question_body:"",answer:"<ul>\n<li>null</li>\n<li>undefined</li>\n<li>boolean</li>\n<li>number</li>\n<li>string</li>\n<li>symbol</li>\n</ul>\n"},{question:"如何区分 JavaScript 中的 6 大基本类型",question_body:"",answer:'<p><code>typeof</code> 可以区分除了 <code>null</code> 以外的其他基本类型</p>\n<p>想要区分所有基本类型可以使用</p>\n<pre class="language-js"><code class="language-js">Object<span class="token punctuation">.</span>prototype<span class="token punctuation">.</span>toString<span class="token punctuation">.</span><span class="token function">call</span><span class="token punctuation">(</span><span class="token punctuation">)</span></code></pre>\n<pre class="language-unknown"><code>null -&gt; [object Null]\nundefined -&gt; [object Undefined]\nnumber -&gt; [object Number]\nstring -&gt; [object String]\nboolean -&gt; [object Boolean]\nsymbol -&gt; [object Symbol]</code></pre>'},{question:"JavaScript 是如何做隐式类型转换的",question_body:"",answer:""},{question:"=== 和 == 有什么区别，什么时候使用 ==？",question_body:"",answer:'<ul>\n<li>== 会做隐式的类型转换，转换过后再进行比较</li>\n<li>=== 不会做类型转换，如果类型不同，会直接返回 false</li>\n</ul>\n<p>大多数时候应该杜绝使用 ==，因为这会让你的代码意图不清晰</p>\n<p>如果你不知道某个值的类型，可以显式地进行类型转换，比如</p>\n<pre class="language-js"><code class="language-js"><span class="token keyword">if</span> <span class="token punctuation">(</span> <span class="token function">Number</span><span class="token punctuation">(</span> x <span class="token punctuation">)</span> <span class="token operator">===</span> <span class="token number">1</span> <span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token comment">// ...</span>\n<span class="token punctuation">}</span></code></pre>\n'},{question:"描述下 JavaScript 中的垃圾回收机制",question_body:"",answer:""}]},{name:"CSS 基础",file:"basic/css.md",id:"44a13d59",questions:[{question:"css 选择器有哪些？",question_body:"",answer:"<ul>\n<li>简单选择器<ul>\n<li>类型选择器（标签）</li>\n<li>class 选择器</li>\n<li>id 选择器</li>\n<li>通用选择器(*)</li>\n<li>属性选择器</li>\n</ul>\n</li>\n<li>伪类选择器</li>\n<li>伪元素选择器</li>\n<li>组合<ul>\n<li><code>+</code></li>\n<li><code>~</code></li>\n<li><code>&gt;</code></li>\n<li>(space)</li>\n</ul>\n</li>\n</ul>\n"},{question:"class 或 id 大小写敏感么？",question_body:"",answer:'<p>敏感，但是 css 本身是大小写不敏感的，比如你可以这么写</p>\n<pre class="language-css"><code class="language-css"><span class="token selector">.klass</span> <span class="token punctuation">{</span>\n  <span class="token property">Color</span><span class="token punctuation">:</span> RED<span class="token punctuation">;</span>\n<span class="token punctuation">}</span></code></pre>\n<p>和下面是等价的</p>\n<pre class="language-css"><code class="language-css"><span class="token selector">.klass</span> <span class="token punctuation">{</span>\n  <span class="token property">color</span><span class="token punctuation">:</span> red<span class="token punctuation">;</span>\n<span class="token punctuation">}</span></code></pre>\n'},{question:"css选择器的匹配过程",question_body:"",answer:"<p>自右向左</p>\n"},{question:"选择器优先级",question_body:"",answer:'<p><strong>题一</strong></p>\n<pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span> <span class="token attr-name">class</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>red blue<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>text<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>div</span><span class="token punctuation">></span></span></code></pre>\n<pre class="language-css"><code class="language-css"><span class="token selector">.blue</span> <span class="token punctuation">{</span>\n  <span class="token property">color</span><span class="token punctuation">:</span> blue<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token selector">.red</span> <span class="token punctuation">{</span>\n  <span class="token property">color</span><span class="token punctuation">:</span> red<span class="token punctuation">;</span>\n<span class="token punctuation">}</span></code></pre>\n<p>最终 text 的颜色是什么？</p>\n<pre class="language-unknown"><code>red</code></pre><p><strong>题二</strong></p>\n<pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>html</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>body</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Here is a title!<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>body</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>html</span><span class="token punctuation">></span></span></code></pre>\n<pre class="language-css"><code class="language-css"><span class="token selector">body h1</span> <span class="token punctuation">{</span>\n  <span class="token property">color</span><span class="token punctuation">:</span> green<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token selector">html h1</span> <span class="token punctuation">{</span>\n  <span class="token property">color</span><span class="token punctuation">:</span> purple<span class="token punctuation">;</span>\n<span class="token punctuation">}</span></code></pre>\n<h3>如何实现一个元素水平和垂直居中</h3>\n'}]},{name:"ES6+",file:"basic/esnext.md",id:"06295aad",questions:[{question:"箭头函数和普通函数有什么区别",question_body:"",answer:"<ul>\n<li>没有自己的 this，使用 call / apply / bind 时第一个参数会被忽略</li>\n<li>没有 arguments</li>\n<li>不能用作构造函数，无法 new，无 prototype</li>\n<li>不能用来定义 generator（内部不能使用yield）</li>\n</ul>\n"},{question:"描述下暂时性死区（Temporal Dead Zone）",question_body:"",answer:'<pre class="language-js"><code class="language-js"><span class="token keyword">function</span> <span class="token function">do_something</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span> bar <span class="token punctuation">)</span> <span class="token comment">// undefined</span>\n  console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span> foo <span class="token punctuation">)</span> <span class="token comment">// ReferenceError</span>\n  <span class="token keyword">var</span> bar <span class="token operator">=</span> <span class="token number">1</span>\n  <span class="token keyword">let</span> foo <span class="token operator">=</span> <span class="token number">2</span>\n<span class="token punctuation">}</span></code></pre>\n<p>let 没有变量提升，在声明执行前，访问使用 let 定义的变量，会导致一个 ReferenceError（const 也一样）</p>\n'}]},{name:"Web 存储",file:"basic/web_storage.md",id:"70e9dea8",questions:[{question:"localStorage / sessionStorage 的区别？",question_body:"",answer:"<p>使用 localStorage 存储的数据没有过期时间的设置，而存储在 sessionStorage 中的数据会在页面会话结束时被清除</p>\n"},{question:"如何定义 sessionStorage 的会话",question_body:"",answer:"<p>sessionStorage 会在页面重新加载或恢复页面时保持原来的会话，在新标签页或窗口打开一个页面时会创建一个新的会话</p>\n"},{question:"如何检测 localStorage 是否为空",question_body:"",answer:"<p>localStorage.length</p>\n"},{question:"和 Web 存储相关的事件",question_body:"",answer:'<pre class="language-js"><code class="language-js">window<span class="token punctuation">.</span><span class="token function">addEventListener</span><span class="token punctuation">(</span> <span class="token string">\'storage\'</span><span class="token punctuation">,</span> <span class="token keyword">function</span> <span class="token punctuation">(</span> e <span class="token punctuation">)</span> <span class="token punctuation">{</span>  \n  <span class="token comment">// e.key</span>\n  <span class="token comment">// e.oldValue</span>\n  <span class="token comment">// e.newValue</span>\n  <span class="token comment">// e.url</span>\n  <span class="token comment">// e.storageArea</span>\n<span class="token punctuation">}</span> <span class="token punctuation">)</span></code></pre>\n<p>触发条件：Storage对象发生变化时（创建/更新/删除），重复设置相同的键值不会触发，Storage.clear至多触发一次</p>\n<p>触发限制：在同一个页面内发生的改变不会起作用，在相同域名下的其他页面（如一个新标签页或iframe）发生的改变才会起作用</p>\n'}]},{name:"浏览器缓存",file:"basic/cache.md",id:"5e12ec8c",questions:[{question:"常见的缓存类型",question_body:"",answer:"<p>按缓存位置分：</p>\n<ul>\n<li>Service Wroker</li>\n<li>Memory Cache</li>\n<li>Disk cache</li>\n</ul>\n<p>按失效策略分：</p>\n<ul>\n<li>强缓存</li>\n<li>协商缓存</li>\n</ul>\n"},{question:"缓存查找的顺序",question_body:"",answer:"<p>自上而下，找到则返回，否则继续</p>\n<ol>\n<li>Service Worker</li>\n<li>Memory Cache</li>\n<li>Disk Cache</li>\n<li>(网络请求)</li>\n</ol>\n"},{question:"如何区分强缓存和协商缓存",question_body:"",answer:"<ul>\n<li>200(from cache)：强制缓存</li>\n<li>304(Not Modified)：协商缓存</li>\n</ul>\n"},{question:"Cache from Memory 和 Cache from Disk 的区别",question_body:"",answer:"<p>Cache from Memory 是浏览器自身的优化行为，它不受 HTTP 协议头控制（no-store是例外）；\nCache from Disk 才是我们平时提到的 HTTP Cache；</p>\n"},{question:"Cache-Control 的配置决策树",question_body:"",answer:'<p>\n  <img width="400" src="https://developers.google.com/web/fundamentals/performance/optimizing-content-efficiency/images/http-cache-decision-tree.png" alt="http-cache-decision-tree">\n</p>\n\n'},{question:"缓存相关的 headers，以及他们是如何生效的",question_body:"",answer:"<ul>\n<li><p><strong>Cache-Control</strong> (HTTP/1.1)</p>\n<p>定义缓存策略，比如何时可以缓存/可以缓存多久</p>\n<p><strong>可缓存性：</strong></p>\n<ul>\n<li>no-cache: 每次需要先和服务器通信，确认资源未发生变化（如果存在ETag），才允许使用之前的缓存</li>\n<li>no-store: 不允许缓存响应，每次请求都必须完整获取</li>\n<li>public: 可以被浏览器或中间存储缓存（即使存在 HTTP 身份验证）</li>\n<li>private: 可以被浏览器缓存，但不能被中间存储缓存（比如 CDN）</li>\n</ul>\n<p><strong>过期时间：</strong></p>\n<ul>\n<li>max-age: 单位秒，比如 <code>max-age: 120</code> 表示可缓存120s</li>\n</ul>\n</li>\n<li><p><strong>ETag</strong></p>\n<p>资源更新检查</p>\n<p>第一次浏览器会拿到ETag，如果缓存过期，会在<code>If-None-Match</code>的header带上ETag的值，和服务器确认资源是否发生变化，如果未发生变化，服务器会响应<code>304 Not Modified</code>，可以再延用max-age时间的缓存</p>\n<p>我们要做的是确保服务端返回ETag header，后续的事情浏览器会替我们完成</p>\n</li>\n</ul>\n"},{question:"如何让客户端更新被缓存的资源",question_body:"",answer:"<p>如果资源被客户端缓存，在缓存失效前，在不更改资源网址的情况下，是没办法做到的，所以我们在资源内容发生变化时，需要更改它的网址，强制用户重新下载</p>\n"},{question:"HTTP Cache 实践举例",question_body:"",answer:"<ul>\n<li>html - Cache-Control: no-cache</li>\n<li>js/css - Cache-Control: max-age=31536000</li>\n<li>image - Cache-Control: max-age=86400</li>\n</ul>\n"},{question:"Cache-Control 默认值/行为",question_body:"",answer:"<p>TODO</p>\n"},{question:"Cache-Control max-age=0 和 no-cache 的关系",question_body:"",answer:"<p>no-cache 等价于 max-age=0, must-revalidate</p>\n\x3c!--\n参考：\nhttps://developers.google.com/web/fundamentals/performance/optimizing-content-efficiency/http-caching\nhttps://mp.weixin.qq.com/s/cUqkG3NETmJbglDXfSf0tg\nhttps://tools.ietf.org/html/rfc7234#section-5.2.1\n--\x3e\n"}]},{name:"性能优化",file:"basic/performance.md",id:"1ddd05e8",questions:[{question:"可以从哪些方面进行前端页面性能优化",question_body:"",answer:'<pre class="language-unknown"><code>✂️ Send less JavaScript (code-splitting)\n😴 Lazy-load non-critical resources\n🗜 Compress diligently! (GZip, Brotli)\n📦 Cache effectively (HTTP, Service Workers)\n⚡️ Minify &amp; optimize everything\n🗼 Preresolve DNS for critical origins\n💨 Preload critical resources\n📲 Respect data plans\n🌊 Stream HTML responses\n📡 Make fewer HTTP requests\n📰 Have a Web Font loading strategy\n🛣 Route-based chunking\n📒 Library sharding\n📱 PRPL pattern\n🌴 Tree-shaking (Webpack, RollUp)\n🍽 Serve modern browsers ES2015 (babel-preset-env)\n🏋️‍ Scope hoisting (Webpack)\n🔧 Don’t ship DEV code to PROD</code></pre><blockquote>\n<p><a href="https://dev.to/addyosmani/im-addy-osmani-ask-me-anything-596c">What are the first performance improvements that you look for when going to a web page</a></p>\n</blockquote>\n<blockquote>\n<p><a href="https://github.com/thedaviddias/Front-End-Performance-Checklist">Front-End Performance Checklist</a></p>\n</blockquote>\n'}]},{name:"同源策略",file:"basic/same-origin-policy.md",id:"0722b39c",questions:[{question:"如何判断同源？",question_body:"",answer:"<p>协议、域名、端口都相同</p>\n"},{question:"常见的跨域方案",question_body:"",answer:'<ul>\n<li><p>窗口通信</p>\n<ul>\n<li><p>document.domain</p>\n<p style="font-size: 13px;">适用于二级域名相同，三级域名不同的场景，比如 <strong>a.example.com</strong> 和 <strong>b.example.com</strong></p></li>\n<li><p>hash + hashchange</p>\n</li>\n<li><p>window.name</p>\n</li>\n<li><p>postMessage</p>\n</li>\n</ul>\n</li>\n<li><p>异步请求</p>\n<ul>\n<li>JSONP</li>\n<li>WebSocket</li>\n<li>CORS</li>\n</ul>\n</li>\n</ul>\n'},{question:"JSONP 有什么限制？",question_body:"",answer:"<p>只能发送 GET 请求</p>\n"},{question:"为什么 WebSocket 没有同源策略的限制",question_body:"",answer:"<p>浏览器发送了 <code>Origin</code> 请求头，服务端可以对此进行校验</p>\n"},{question:"描述下预检请求（Preflight request）",question_body:"",answer:""},{question:"form 表单可以跨域吗？",question_body:"",answer:"<p>可以，因为表单提交后会刷新页面，原页面的js拿不到响应内容</p>\n"}]},{name:"事件循环",file:"basic/event-loop.md",id:"26f13dd2",questions:[{question:"描述下事件循环机制",question_body:"",answer:""}]}],id:"5435aa3e"},{name:"前端高级",icon:"crown",id:"543dc987"},{name:"NodeJS",icon:"nodejs",id:"49f46661"},{name:"学习能力",icon:"experiment",id:"57b5eb6e"},{name:"思维方式",icon:"bulb",id:"5a8db223"},{name:"问题解决能力",icon:"thunderbolt",id:"3d08604e"},{name:"沟通能力",icon:"smile",id:"6080decf"}];
